int n,m,dist,k,ans,dem;
char s[510][510];
string ss;
vector<int> c,d;
vector<pair<int,int>> a,b;
int32_t main(){
	cin>>n>>m>>dist>>k;

	if(n==1){
	cin>>ss;

    for (int i = 0; i <m; i++) {

		if(ss[i]=='M') c.push_back(i);
		if(ss[i]=='S') d.push_back(i);
	}
	 sort(d.begin(),d.end());
	 for(int x: c){
	 	int val=x+dist;
		int vt=upper_bound(d.begin(),d.end(),val)-d.begin();
		if(d[vt]>val) --vt;
		if(vt+1>=k) ++ans;
	 }
	cout<<ans;
	return 0;
	}


	for(int i=1; i<=n; ++i){
		for(int j=1; j<=m; ++j){
			cin>>s[i][j];
			if(s[i][j]=='M') a.push_back({i,j});
			if(s[i][j]=='S') b.push_back({i,j});
		}
	}

    for(pair<int,int> x: a){
		dem=0;
		for(pair<int,int> y: b){
			if(max(abs(x.st-y.st),abs(x.nd-y.nd))<=dist) ++dem;
			if(dem>=k) {++ans;break;}
		}
	}

    cout<<ans;

    return 0;
}

