#include <bits/stdc++.h>
#define ll long long
#define st first
#define nd second

using namespace std;

const int mod = 1e9 + 7;

int n, s, k, r[51], ans = INT_MAX;
pair<int, int> dp[51][51];
string str;

int main() {
	cin.tie(0) -> sync_with_stdio(0);
	
	// freopen("testCase.inp", "r", stdin);
    // freopen("testCase.out", "w", stdout);
	
	cin >> n >> s >> k;
	
	memset(dp, 0, sizeof dp);
	
	for (int i = 0; i < n; i++) {
		cin >> r[i];
		
		dp[i][i].st = r[i];
	} 
	
	for (int i = s - 2; i >= 0; i--) dp[i][i].nd = s - i - 1;
	
	cin >> str;
	
	for (int i = s - 1; i >= 0; i--) {
		int pre_pos = i;
		
		for (int j = i + 1; j < n; j++) {
			
			dp[i][j].st = dp[i][j - 1].st;
			dp[i][j].nd = dp[i][j - 1].nd;
			
			if (str[j] != str[j - 1]) {
				if (dp[i][j].st < dp[i][j - 1].st + r[j]) {
					dp[i][j].st = dp[i][j - 1].st + r[j];
					dp[i][j].nd = dp[i][j - 1].nd + 1;
				}
				
				pre_pos = j - 1;
			}
			
			else {
				if (dp[i][j].st < dp[i][pre_pos].st + r[j]) {
					dp[i][j].st = dp[i][pre_pos].st + r[j];
					dp[i][j].nd = dp[i][pre_pos].nd + (j - pre_pos - 1) + 1;
				}
			}
		
			// cout << i << ' ' << j << ' ' << dp[i][j].st << ' ' << dp[i][j].nd << endl;
		}	
	}
	
	for (int i = s - 1; i >= 0; i--) {
		for (int j = i; j < n; j++) {
			if (dp[i][j].st >= k) {
				ans = min(ans, dp[i][j].nd);
			}
		}
	}
	
	cout << ans;
}

