using namespace std;

const int N = (int)2e5 + 7;

ll l;
int n;
int lc[18][N], pr[N];
ll lcsum[18][N], d[N];
vector < int > gr[N];
int pref[N];

void dfs(int v) {
	for (int i = 1; i <= 17; i++) {
		lc[i][v] = lc[i - 1][lc[i - 1][v]];
		lcsum[i][v] = lcsum[i - 1][v] + lcsum[i - 1][lc[i - 1][v]];
	}
	int cur = v;
	ll sum = 0;
	for (int i = 17; i >= 0; i--) {
		if (sum + lcsum[i][cur] <= l) {
			sum += lcsum[i][cur];
			cur = lc[i][cur];
		}
	}
	//cout << v << ' ' << cur << endl;
	cur = lc[0][cur];
	pref[cur]--;
	pref[v]++;
	for (int to : gr[v]) {
		dfs(to);
	}
}

void dfs1(int v) {
	for (int to : gr[v]) {
		dfs1(to);
		pref[v] += pref[to];
	}
}

