#include<bits/stdc++.h>

#define f first
#define s second

using namespace std ;

typedef pair< int , int > ii ;

const int maxN = 3e5 + 10 ;
const int oo = 1e9 + 10 ;

int n , k , m ;

struct event {
    int x , t , y , delta ;

    event () {}
    event (int _x , int _t , int _y , int _delta) : x(_x) , t(_t) , y(_y) , delta(_delta) {}

    bool operator < (const event &other) const {
        return y < other.y ;
    }
};

struct query {
    int x , y , id ;

    query () {}
    query (int _x , int _y , int _id) : x(_x) , y(_y) , id(_id) {}

    bool operator < (const query &other) const {
        return y < other.y ;
    }
};

int L[maxN << 2] , R[maxN << 2] , st[maxN << 2] ;
vector< ii > val ;

void build (int id , int l , int r) {
    L[id] = l ; R[id] = r ;
    st[id] = -1 ;

    if (l == r) return ;

    int mid = (l + r) >> 1 ;
    build(id << 1 , l , mid) ;
    build(id << 1 | 1 , mid + 1 , r) ;
}

void update (int id , int p , int val) {
    if (L[id] == R[id]) {
        st[id] = val ;
        return ;
    }

    if (p <= R[id << 1]) update(id << 1 , p , val) ;
    else update(id << 1 | 1 , p , val) ;

    st[id] = max(st[id << 1] , st[id << 1 | 1]) ;
}

int get (int id , int u , int v) {
    if (v < L[id] || R[id] < u || v < u) return -1 ;
    if (u <= L[id] && R[id] <= v) return st[id] ;
    return max(get(id << 1 , u , v) , get(id << 1 | 1 , u , v)) ;
}

multiset< int > s[maxN] ;
int exist = 0 ;

void add (int x , int t) {
    if (s[t].find(x) == s[t].end()) {
        auto r = s[t].upper_bound(x) ;
        auto l = r ; l -- ;
        update(1 , *l , x) ;
        update(1 , x , *r) ;
    }
    s[t].insert(x) ;
    if (int(s[t].size()) == 3) exist ++ ;
}

