int DP(int msk, int i, int cur) {
  if (i == n) {
    return 0;
  }
  auto &res = dp[i][cur];
  if (~res) {
    return res;
  }

  if (i + 4 < n) {
    for (int j = 0; j < 2; j++) {
      res = max(res, DP(msk, i + 1, (cur | (j << 4)) >> 1) + g[i][cur | (j << 4)]);
    }
  }
  else {
    int j = (msk >> (4 + i - n)) & 1;
    res = max(res, DP(msk, i + 1, (cur | (j << 4)) >> 1) + g[i][cur | (j << 4)]);
  }

  return res;
}

